    render() {
        return (
            <div>
                <form>
                <label>
                    Name :
                    <input type="text" name="email" />
                </label>
                <label>
                    Password :
                    <input type="text" name="password" />
                </label>
                <input type="submit" value="Envoyer" />
                </form>
            </div>
        )
    }
}
